    false,nt"url": null,nt"notes": "This narrative report for National Elk
    Refuge outlines Refuge accomplishments from November of 1940 through January of
    1941. The report begins by summarizing the weather conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, and predators-
    is also covered. The Refuge development and maintenance section discusses physical
    developments. The public relations section discusses Refuge visitors. A progress
    report on field investigations and applied research is also provided. Photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
